import React from 'react'
import { Button, Avatar, Badge, List, Cell, Section } from '@telegram-apps/telegram-ui';
import newtonwapple from './newtonwithapple.png';

export default function HowToPlay() {
  return (



<div
            style={{
              display: "flex",
              flexDirection: "column",
              backgroundColor: 'grey',
              height: "80px",
              width: "100vw",
              padding: 20,
              gap: 10,
            }}
          >
  <img
                  src={newtonwapple}
                  style={{
                    maxWidth: "100%",
                    maxHeight: "auto",
                    objectFit: "contain",
                  }}
                />
            <div
              style={{
                flexGrow: 1,
                display: "flex",
                flexDirection: "column",
                justifyContent: "space-between",
                width: "90%",
              }}
            >

              <Button
                style={{
                  backgroundColor: "white",
                  color: "black",
                }}
              >
              
                 <span style={{ fontSize: 20, fontWeight: "bold" }}>
                How to play?
              </span>
              </Button>
            </div>
            
          </div>

)
}
